subproject.description:
Project outputs:
- Increased access of of Injecting Drug Users (IDUs) , Sex Workers (SW), men having sex with other men (MSM),  uniformed staff and rural youth to HIV/AIDS prevention services;
- Voluntary counseling and testing system is expanded and strengthened;
- Ensured safety of blood transfusions country-wide;
- Established enabling environment and strengthening  public health care system that supports coordinated HIV interventions
